import React from 'react';
import { useParams } from 'react-router-dom';

function getCityImage() {
  const list = [
    { name: 'tea', photo: 'https://source.unsplash.com/500x800/?hamburg' },
    { name: 'coffee', photo: 'https://source.unsplash.com/199x200/?coffee' },
    {
      name: 'chocolate',
      photo: 'https://source.unsplash.com/199x200/?chocolate',
    },
  ];

  const param = useParams();
  console.log(param.productName);
  console.log(param);
  return (
    <div>
      <h1> Products Page</h1>
      <h4>{param.productName}</h4>
      {list
        .filter((item) => item.name === param.productName)
        .map((product) => (
          <img src={product.photo} />
        ))}
    </div>
  );
}

export default getCityImage;
